PREFIX dbp: <http://dbpedia.org/property/>
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX pv: <http://ld.company.org/prod-vocab/>
SELECT ?category ?hardware ?weight ?type WHERE {
  {
    SELECT ?category ?hardware (MIN(?weight) AS ?weight) WHERE {
      ?hardware a pv:Hardware ;
               pv:weight_g ?weight ;
               pv:hasCategory ?category .
    } GROUP BY ?category ?hardware
  } UNION
  {
    SELECT ?category ?hardware (MAX(?weight) AS ?weight) WHERE {
      ?hardware a pv:Hardware ;
               pv:weight_g ?weight ;
               pv:hasCategory ?category .
    } GROUP BY ?category ?hardware
  }
}

